import logo from './images/mylogo.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="App-logo">
          <img src={logo} alt="logo" />
        </div>
        <div class="App-top-menu">
          Masha Website
        </div>
      </header>
    </div>
  );
}

export default App;
